import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import { useParams } from "react-router-dom";
import axios from "axios";
import "./ProjectsPath.css";
import { useNavigate } from "react-router-dom";


export default function ProjectsPath() {
  const navigate = useNavigate();

  return (
    <>
      <div className="paths">
        <div className="paths-div">Web Applications
        navigate(/)
        </div>
        <div className="paths-div">Android Applications</div>
        <div className="paths-div">IOS Applications</div>
        <div className="paths-div">User Interfaces</div>
        <div className="paths-div">User Experiance</div>
        <div className="paths-div">Security Systems</div>
      </div>
    </>
  );
}
